"use strict";(self.webpackChunkheidelbergman_site=self.webpackChunkheidelbergman_site||[]).push([[477],{10:e=>{e.exports=JSON.parse('{"blogPosts":[{"id":"/2022/09/15/ Heart Racer Junior Triathlon 2022","metadata":{"permalink":"/blog/2022/09/15/ Heart Racer Junior Triathlon 2022","source":"@site/blog/2022-09-15 Heart Racer Junior Triathlon 2022/index.md","title":"Heart Racer Junior Triathlon 2022","description":"1","date":"2022-09-15T00:00:00.000Z","formattedDate":"15. September 2022","tags":[],"hasTruncateMarker":false,"authors":[{"name":"Katja Schuhmacher","title":"Triathlonakademie","url":"https://triathlonakademie.de/","imageURL":"https://triathlonakademie.de/wp-content/uploads/2019/02/Katja-Schumacher-225x300.png","key":"katja"}],"frontMatter":{"title":"Heart Racer Junior Triathlon 2022","authors":"katja"},"nextItem":{"title":"Bilder 2022","permalink":"/blog/2022/08/23/Photos 2022"}},"content":"![1](./img/HeartRacer.22.1.jpeg)\\n\\n## Mehr als 150 Teilnehmer*innen beim Heart Racer Junior Triathlon 2022\\n\\nAm 11.September fand der Heart Racer Junior Triathlon im Freizeibad Tiergartenstrasse in Heidelberg statt. Mit 152 Finishern waren wir in diesem Jahr die gr\xf6\xdfte Veranstaltung des Rhein Neckar Triathlon Cup f\xfcr die Junioren.\\n\\nDie neuen Organisatoren vom Heart Racer Team und SV Nikar Heidelberg durften die 7 \u2013 18 j\xe4hrigen Starter bei bestem Wetter auf die Strecke schicken. Es waren 5 Altersklassen und Staffeln auf unterschiedlichen Strecken unterwegs.\\n\\nDie Kleinsten starteten \xfcber 50m Schwimmen, 2km Radfahren und 400m Laufen, die \xc4ltesten mussten mit 200m Schwimmen, 12km Radfahren und 2,8km Laufen schon deutlich mehr Strecke zur\xfccklegen.\\n\\nMit gro\xdfer Unterst\xfctzung der Eltern und freiwilligen Helfer an der Strecke hatten wir viele gl\xfcckliche Kinder und Jugendliche, die zu Recht stolz auf ihre Leistungen sein durften.\\n\\n![1](./img/HeartRacer.22.2.jpeg)\\n\\nBesonders gefreut haben wir uns \xfcber die beiden Heart Racer Jugendlichen, die zusammen mit ihren Guides ihren ersten Triathlon gefinished haben. Wir hatten im Sommer in einem Camp trainiert und Leon und Linus haben sich der Herausforderung Triathlon gestellt. Begleitet von Robert und Markus haben sie es geschafft und durften wie alle anderen im Ziel ihr Finisher Geschenk und viele Gl\xfcckw\xfcnsche entgegennehmen.\\n\\nWir hoffen im n\xe4chsten Jahr wieder auf eine gelungene Veranstaltung und w\xfcrden uns freuen noch etwas mehr Unterst\xfctzung bei der Organisation zu haben. Wenn Eltern oder andere freiwillige Lust und Zeit haben uns zu unterst\xfctzen, meldet Euch info@heart-racer.org.\\n\\n![1](./img/HeartRacer.22.3.jpeg)\\n\\nGanz herzliches Dankesch\xf6n an alle Helfer und ein besonderes Dankesch\xf6n an die Stadtwerke Heidelberg und die Stadt Heidelberg, die uns seit Jahren unterst\xfctzen und die Veranstaltung m\xf6glich machen.\\n\\n\\n\\n[Zur Heart Racer Seite](https://www.heart-racer.org/mehr-als-150-teilnehmerinnen-beim-heart-racer-junior-triathlon-2022/)"},{"id":"/2022/08/23/Photos 2022","metadata":{"permalink":"/blog/2022/08/23/Photos 2022","source":"@site/blog/2022-08-23-Photos 2022/index.md","title":"Bilder 2022","description":"Unser Partner larasch hat Eure Bilder >>online<<","date":"2022-08-23T00:00:00.000Z","formattedDate":"23. August 2022","tags":[],"hasTruncateMarker":true,"authors":[{"name":"Stephan Klevenz","title":"Heidelbergman Orga Team","url":"https://github.com/sklevenz","imageURL":"https://github.com/sklevenz.png","key":"sklevenz"}],"frontMatter":{"title":"Bilder 2022","authors":"sklevenz"},"prevItem":{"title":"Heart Racer Junior Triathlon 2022","permalink":"/blog/2022/09/15/ Heart Racer Junior Triathlon 2022"},"nextItem":{"title":"Neue Webseite","permalink":"/blog/2022/08/22/Docusaurus"}},"content":"Unser Partner larasch hat Eure Bilder [>>online<<](https://events.larasch.de/heidelbergman/fotos)\\n\\n![Laura](https://larasch.de/images/eventFiles/heidelbergman-2022/dsc3199-73330461.jpg)\\n\\n\x3c!--truncate--\x3e\\n\\n![Malte](https://larasch.de/images/eventFiles/heidelbergman-2022/dsc3112-73271882.jpg)\\n\\n![Sebb](https://larasch.de/images/eventFiles/heidelbergman-2022/dsc3134-73303269.jpg)"},{"id":"/2022/08/22/Docusaurus","metadata":{"permalink":"/blog/2022/08/22/Docusaurus","source":"@site/blog/2022-08-22-Docusaurus/index.md","title":"Neue Webseite","description":"Der HeidelbergMan Triathlon hat eine neue Webseite.","date":"2022-08-22T00:00:00.000Z","formattedDate":"22. August 2022","tags":[],"hasTruncateMarker":true,"authors":[{"name":"Stephan Klevenz","title":"Heidelbergman Orga Team","url":"https://github.com/sklevenz","imageURL":"https://github.com/sklevenz.png","key":"sklevenz"}],"frontMatter":{"title":"Neue Webseite","authors":"sklevenz"},"prevItem":{"title":"Bilder 2022","permalink":"/blog/2022/08/23/Photos 2022"}},"content":"## Der HeidelbergMan Triathlon hat eine neue Webseite.\\n\\nDiese Webseite wurde mit [Docusaurus 2.0](https://docusaurus.io/) erstellt und wird als Open Source Projekt auf [Github](https://github.com) als [Github Pages Projekt](https://github.com/heidelbergman-de/heidelbergman-de.github.io) gehostet. \\n\\n\x3c!--truncate--\x3e\\n\\nOpen Source bedeutet, Ihr d\xfcrft hier selbst mitarbeiten. Das beginnt mit profanen Dingen wie Tippfehler verbessern, Informationen erg\xe4nzen oder neue Beitr\xe4ge schreiben. Damit das klappt sind zwei Dinge wichtig:\\n\\n![Docusaurus](./img/docusaurus.svg)\\n\\n1. Diese Seiten basieren auf [Docusaurus 2.0](https://docusaurus.io/). [Docusaurus 2.0](https://docusaurus.io/) ist eine Software die von [Facebook](https://facebook.com) entwickelt wurde und die ursp\xfcnglich f\xfcr die Entwicklung von Dokumentationsseiten von Software Projekten gedacht ist. Inzwischen werden sehr viele Open Source Software Projekte damit erstellt und die Web Seite vom [HeidelbergMan](https://www.heidelbergman.de). Ihr m\xfc\xdft Euch also mit Docusaurus auskennen. Wir erstellen damit einfach statische Webseiten und diese Blog Eintr\xe4ge hier.\\n\\n![Github](./img/github-logo.png)\\n\\n2. Das Projekt wird auf [Github](https://github.com) gehostet und um hier mithelfen zu k\xf6nnen, mu\xdf man sich mit [Git](https://git-scm.com/) und [Github](https://github.com) auskennen. Wer sich damit auskennt kann [hier](https://github.com/heidelbergman-de/heidelbergman-de.github.io/issues) ein Issue aufmachen und einen [Pull Request](https://docs.github.com/en/pull-requests/collaborating-with-pull-requests/proposing-changes-to-your-work-with-pull-requests/about-pull-requests) stellen.\\n\\nWer sich damit nicht auskennt, kann uns aber auch einfach eine Mail an info[at]heidelbergman.de schicken. Wir bringen dann Euer Feedback hier ein."}]}')}}]);